import React from "react";
import Nav from "../generalLayout/nav";

import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import Motor3dBodyTech from "../generalLayout/motor3d-body-tech";
const namePage = "Brutale 1000 RR";
const listImgs = [
  {
    contentTitle: "Dedicated control unit",
    img: "brutale1000rr/electronics-l.jpg",
    content:
      "The Brutale 1000 RR features a full ride-by-wire multi map system with IMU inertial platform, which manages traction control with slip strategies (8 different settings and the option to deactivate it). Also featuring a Front Lift Control system with active and non-active options, it gives the rider entire freedom of action. The Brutale 1000 RR is equipped with a second generation TFT dashboard.",
  },
  {
    contentTitle: "Semi-dry sump",
    img: "brutale1000rr/safety-m.jpg",
    content:
      "The new splitter lubrication system, deriving from Mv Agusta’s racetrack experience, allows oil to be separated from moving mechanical parts. The semi-dry sump lubrication is capable of guaranteeing mechanical protection under extreme riding conditions such as sharp leans and wheelies, yet without compromises in terms of friction levels, that remain significantly low.",
  },
  {
    contentTitle: "SAFETY",
    img: "rush1000/rush4.jpg",
    content:
      "The Öhlins EC electronic regulation package for the fork, the steering damper and the shock absorber fixed to the single-sided swing arm provides optimum driving control in all road conditions.",
  },
];
export default function BodyBrutale1000RR() {
  function scrollFunction() {
    if (document.documentElement.scrollTop > window.innerHeight / 3) {
      document
        .getElementsByClassName("mv-nav")[0]
        .classList.add("mv-nav-onScroll");
      for (
        var i = 0;
        i < document.getElementsByClassName("mv-container-div").length;
        i++
      ) {
        document
          .getElementsByClassName("mv-container-div")
          [i].classList.add("mv-container-div-onScroll");
      }
      document.getElementsByClassName("mv-nav-compact")[0].style.display =
        "flex";
      document
        .getElementsByClassName("mv-nav")[0]
        .classList.add("openMainMenu");
    } else {
      document
        .getElementsByClassName("mv-nav")[0]
        .classList.remove("mv-nav-onScroll");
      for (
        var key = 0;
        key < document.getElementsByClassName("mv-container-div").length;
        key++
      ) {
        document
          .getElementsByClassName("mv-container-div")
          [key].classList.remove("mv-container-div-onScroll");
      }
      document.getElementsByClassName("mv-nav-compact")[0].style.display =
        "none";
      document
        .getElementsByClassName("mv-nav")[0]
        .classList.remove("openMainMenu");
    }
  }

  window.onscroll = function () {
    scrollFunction();
  };

  return (
    <>
      <PageName namePage={namePage} />
      <Nav />
      <Motor3d
        imgLocate="brutale1000rr/1000rr"
        nameModel="𝙈𝙫 𝘼𝙜𝙪𝙨𝙩𝙖 𝘽𝙧𝙪𝙩𝙖𝙡𝙚 1000 𝙍𝙍"
        price="27K€"
      />
      <Motor3dBodyTech listImgs={listImgs}/>
    </>
  );
}
